import './App.css';

import MainPage from "./mainpage/MainPage";

import {BrowserRouter as Router, Route, Switch} from "react-router-dom";
import HomeContent from "./pages/src/home";
import Header from "./components/header/Header";
import Footer from "./components/footer/Footer";
import CppContent from "./pages/src/cpp";
import PyContent from "./pages/src/py";
import JavaContent from "./pages/src/java";
import JsContent from "./pages/src/js";
import TsContent from "./pages/src/ts";
import HTMLContent from "./pages/src/html";


function App() {
  return (
    <div>
        <Header/>
        <Router>
            <Switch>
                <Route exact path="/">
                    <HomeContent/>
                </Route>
                <Route path="/cpp">
                    <CppContent/>
                </Route>
                <Route path="/python">
                    <PyContent/>
                </Route>
                <Route path="/java">
                    <JavaContent/>
                </Route>
                <Route path="/javascript">
                    <JsContent/>
                </Route>
                <Route path="/typescript">
                    <TsContent/>
                </Route>
                <Route path="/html-css">
                    <HTMLContent/>
                </Route>
            </Switch>
        </Router>
        <Footer/>
    </div>
  );
}


export default App;
